INSERT INTO `hprojects` VALUES (1,'PTTEP-Offshore surplus','WPN ได้รับคัดเลือกจาก PTTEP ในการจัดซื้ออุปกรณ์ที่เหลือใช้จากกระบวนการขุดเจาะและการผลิตของ (E&P) อาทิ หัวขุดเจาะ Drilling Bits, Casing, Production Tubing, Wellhead Christmas Tree, Structure Steel, Sparepart รวมถึงอุปกรณ์ทางเรือ เช่น Offshore Crane, Mooring Rope, Anchor, Fender ฯลฯ โดยอุปกรณ์ต่างๆสามารถนำไปใช้เพื่อนำเข้าสู่กระบวนการ reused และ รีไซเคิลเพื่อจำหน่ายต่อไป',1,'2023-04-11 09:23:21','2023-05-11 10:23:27','1682270561-highlight_project620x640.jpg'),(2,'Thai Oil Refinery','WPN ได้รับการคัดเลือกจากโรงกลั่นน้ำมันไทยออยล์จัดซื้ออุปกรณ์ที่เหลือใช้จากโครงการและขบวนการผลิตของโรงกลั่นน้ำมัน อาทิ สายไฟ ท่อเหล็ก เหล็กถังน้ำมัน เครื่องจักร หม้อแปลงแรงสูงขนาดใหญ่ ฯลฯ โดย WPN ได้นำเข้าสู่กระบวนการรีไซเคิลอย่างมีประสิทธิภาพ และเน้นขบวนการการนำวัสดุที่ได้มาไปใช้ประโยชน์ในอุตสาหกรรมอื่น เช่น แผ่นถังน้ำมันซึ่งเป็นเศษเหล็กมาทำเป็นแผ่นเหล็ก เพื่อนำไปใช้ในงานปูพื้น อุตสาหกรรมต่อเรือ ส่วนท่อน้ำมันได้นำไปใช้ในอุตสาหกรรมเรือดูดทราย เป็นต้น หม้อแปลงไฟฟ้าได้นำไปตรวจสอบและรับรองระบบเพื่อนำไปใช้ใหม่หรือนำมาแยกส่วนเพื่อจำหน่ายต่อไป',1,'2023-04-11 09:23:33','2023-05-17 17:15:01','1684318501-S__217071742.jpg'),(3,'AGC Vinythai Chemical','WPN ได้รับการคัดเลือกจาก AGC Vinythai Chemical ในการจัดซื้อเหล็กและอุปกรณ์ทั้งหมดของอาคารขบวนการผลิต และอาคารคลังจัดเก็บวัตถุดิบ โดย WPN ได้นำเหล็กบีมและเหล็กทั้งหมดที่เป็นโครงสร้างของโรงงานเข้าสู่กระบวนการรีไซเคิล ด้วยการนำมาตัดแต่งเพื่อนำกลับไปใช้ประโยชน์ในงานอื่น ๆ ไม่ว่าจะเป็นการสร้างโรงงานใหม่ สร้างบ้าน หรือสร้างสำนักงาน เป็นต้น',1,'2023-04-11 09:23:41','2023-05-17 17:25:35','1684319135-1154585.jpg'),(4,'Metropolitan Electricity Authorit','WPN ได้รับการคัดเลือกจากการไฟฟ้านครหลวง (กฟน.) ให้ชนะประมูลการจัดซื้อหม้อแปลงไฟฟ้าจำนวนกว่า200ลูกที่หมดอายุการใช้งานทั้งในเขตกรุงเทพฯ และปริมณฑลของการไฟฟ้านครหลวง โดย WPN ได้นำหม้อแปลงเข้าสู่กระบวนการรีไซเคิล ด้วยการคัดแยกชิ้นส่วนซึ่งได้ทั้งน้ำมัน ทองแดง และเหล็ก เพื่อจำหน่ายต่อไป',0,'2023-04-11 09:23:52','2023-06-27 11:39:46','1682270618-policy 448x542.jpg'),(5,'Supavut Industry Co., Ltd.','WPN ได้รับการคัดเลือก ประมูลรื้อถอนและซื้อวัสดุส่วนอาคาร เครื่องจักร และอุปกรณ์ในโรงงาน จากบริษัท สุภาวุฒิ อินดัสทรี จำกัด ซึ่งเป็นผู้ผลิตชิ้นส่วนพลาสติกในอุตสาหกรรมรถยนต์รายใหญ่ของประเทศไทย โดยทีมงานมืออาชีพที่ประสบการณ์ด้านโครงการการรื้อถอน ด้วยเครื่องจักรใหญ่ ควบคุมตั้งแต่การวางแผนและออกแบบการรื้อถอน จนถึงขั้นตอนการขนย้ายวัสดุที่ไม่ใช้แล้วสู่ขบวนการรีไซเคิลต่อไป',1,'2023-05-11 10:28:13','2023-05-17 18:43:34','1684323814-S__217071819.jpg'),(6,'PTT Global Chemical PCL','WPN ได้รับการคัดเลือกจาก บริษัท พีทีที โกบอล เคมิคอล จำกัด (มหาชน) หรือ GC ซึ่งเป็นบริษัทอันดับหนึ่งของโลกในกลุ่มธุรกิจเคมีภัณฑ์ ในการขนย้าย และรื้อถอน Pressure Vessel หรือ หอกลั่นปิโตรเคมีขนาดใหญ่ น้ำหนักมากกว่า 200 ตัน โดยการขนย้ายที่มีมาตรฐานความปลอดภัยสูงสุด',1,'2023-05-11 10:29:20','2023-05-17 18:02:29','1684321083-S__217071794.jpg');
