INSERT INTO `news` VALUES (1,'10 อันดับขยะที่นิยมนำมารีไซเคิลมากที่สุด','พลาสติก ขยะประเภทพลาสติกมีจำนวนเพิ่มขึ้นอย่างรวดเร็ว เพราะสินค้าและบรรจุภัณฑ์ส่วนมากทำมาจากพลาสติก เช่น ขวดนม กระป๋องยา ขวดน้ำดื่ม ซึ่งคุณสมบัติที่เหมาะสมของพลาสติกซึ่งมีน้ำหนักเบา สีสันสวยงามไม่เป็นสนิม','1676915520.png','<p>10 อันดับขยะที่นิยมนำมารีไซเคิลมากที่สุด ดังนี้<br>1. พลาสติก ขยะประเภทพลาสติกมีจำนวนเพิ่มขึ้นอย่างรวดเร็ว เพราะสินค้าและบรรจุภัณฑ์ส่วนมากทำมาจากพลาสติก เช่น ขวดนม กระป๋องยา ขวดน้ำดื่ม ซึ่งคุณสมบัติที่เหมาะสมของพลาสติกซึ่งมีน้ำหนักเบา สีสันสวยงามไม่เป็นสนิม ทนทานและมีหลายประเภททำให้พลาสติกเป็นที่นิยมมากในปัจจุบัน ซึ่งขยะพวกนี้เมื่อนำมาเผาก็จะทำให้เกิดมลพิษสิ่งแวดล้อม หรือหากนำไปผงกลบ ก็จะทำให้สิ้นเปลืองเนื้อที่ในการฝังกลบ วิธีการที่ดีและเหมาะสมสำหรับการกำจัดขยะพลาสติก ก็คือ การนำกลับมารีไซเคิล พลาสติกสามารถนำกลับมารีไซเคิลได้เกือบทุกประเภท ส่วนพลาสติกที่ไม่สามารถกลับมารีไซเคิลได้ ได้แก่ พลาสติกชนิดยูเรีย เมลามีน และอีพอกซี่ ถึงแม้ว่าพลาสติกสามารถนำกลับมารีไซเคิลได้แต่ในประเทศยังไมได้มีการนำเอาพลาสติกกลับมารีไซเคิลทุกประเภทเพราะปัญหาในเรื่องการคุ้มทุนในการลงทุน เนื่องจากพลาสติกมีน้ำหนักเบาและเก็บรวบรวมได้อยาก เช่น ถุงพลาสติกและ โฟม สามารถนำกลับมารีไซเคิลได้แต่ต้นทุนสูงเนื่องมาจากมีปริมาณมากเปลืองพื้นที่ในการขนส่งทำให้ต้นทุนสูง<br><br>2. กล่องนม นมกล่อง ไม่ใช่แค่ดื่มแล้วมีประโยชน์ มีหลายคนนำกล่องนมเปล่าที่ดื่มหมดแล้วนำไปทำงานประดิษฐ์ สมัยนี้มีไอเดียใหม่ๆ ที่สามารถทำให้กล่องนมดูมีราคา สร้างรายได้เป็นกอบเป็นกำให้กับนักประดิษฐ์งานรีไซเคิลได้มากทีเดียว<br><br>3. กระป๋องน้ำอัดลม น้ำอัดลม เป็นเครื่องดื่มยอดฮิตในหลายคนที่หลายคนติดในรสชาติ แต่พอดื่มหมดก็ทิ้งกระป๋องน้ำอัดลมลงขยะ แต่หากมองสีสันของกระป๋องหลากสีดูน่าสนใจไม่น้อย นั่นจึงมีบางคนนำเอากระป๋องเหล่านี้มาเพิ่มคุณค่าของมันด้วยความคิดสร้างสรรค์ใหม่ๆ กลายเป็นชิ้นงานประดิษฐ์ที่ทั้งน่ารักและน่าทึ่งอย่างมาก<br><br>4. กระดาษ ขยะจากบ้านเรือนและสำนักงานจะมีกระดาษ ที่สำคัญในชีวิตประจำวันของเรา จะต้องเกี่ยวพันกับการใช้กระดาษ ไม่ว่าจะเป็นหนังสือพิมพ์ กระดาษคอมพิวเตอร์ ถุงกระดาษ ลังกระดาษ เป็นต้น กระดาษเหล่านี้ส่วนใหญ่สามารถนำกลับมารีไซเคิลได้&nbsp;</p><p>5. แก้ว แก้วเป็นผลิตภัณฑ์ที่ทำมาจากทรายโดยมีหินและโซดาไฟเป็นส่วนผสม โดยนำมาหลอมให้ขึ้นรูปเป็นภาชนะต่างๆ เช่นแก้วน้ำ ขวดอาหารและเครื่องดื่ม แก้วเป็นวัสดุที่ไม่สามารถย่อยสลายได้ แต่สามารถหลอมทำใหม่ได้ ขวดแก้วทุกประเภทสามารถนำมารีไซเคิลได้ แต่ขวดแก้วต่างประเภทต่างสีจะมีราคาต่างกัน ดังนั้นขวดแก้วสีขาวจะมีราคาดีที่สุด รองลงมา คือ สีชา และสีเขียว ถ้าเป็นลักษณะที่ขวดไม่แตกจะได้ราคาสูงกว่าขวดแตกหรือเศษแก้ว ดังนั้นจึงมีการคัดแยกออกตามสีและคุณภาพของแก้ว ดังนี้ - ขวดแก้วดี - ขวดแก้วแตก<br><br>6. เศษผ้า เราคงรู้อยู่แล้วว่าเศษผ้าหลาย ๆ สีเหล่านี้นำมารีไซเคิลเป็นของใช้ได้หลายชนิดหลายแบบมาก ไม่ว่าจะเป็นพวงกุญแจ ปกหนังสือ รวมถึงแปรรูปเป็นสิ่งของต่างๆ มากมาย ให้กลายมาเป็นของประดับสุดเก๋ไม่เหมือนใคร<br><br>7. แก้ว/ขวดแก้ว ขวดแก้วเป็นอีกหนึ่งขยะรีไซเคิลยอดฮิต ที่เราใช้แล้วก็ทิ้งกันโดยไม่ได้คิดว่าจะนำมาใช้ทำประโยชน์อะไร แต่ก็ยังมีหลายคนเห็นประโยชน์ของขวดแก้ว นำมันมารีไซเคิลใหม่ และสามารถนำมาทำเป็นธุรกิจสวนตัวเป็นรายได้เข้ากระเป๋าตังได้แบบกิ๊บเก๋จริงๆ<br><br>8. ยางรถยนต์ บางคนคิดไม่ถึงว่ายางรถยนต์แบบนี้จะนำมาเพิ่มมูลค่าได้มากมายขนาดนี้ และจะกลายมาเป็นธุรกิจใหญ่ที่ทำเงินได้มากมาย เป็นความคิดที่มีไอเดียดีสุดๆ ไปเลย และยังทำได้หลากหลายรูปแบบอีกด้วย หรือจะทำตามออเดอร์ลูกค้าก็ยังได้ เป็นงานฝีมือที่มีความละเอียดและใส่ใจในงานจริง<br><br>9. หลอดน้ำ หลอดน้ำที่เราใช้ดูดน้ำกัน ทำมาจากพลาสติดมีสีสันสดใส เหมาะที่จะนำไปรีไซเคิล ตกแต่งให้สวยงามได้อย่างไม่ยาก นับว่าเป็นงานประดิษฐ์ขั้นพื้นฐานระดับประถม แต่สวยสดใสไม่แพ้งานฝีมือชิ้นใดในโลก<br><br>10.หลอดไฟ หลอดไฟ จัดอยู่ในขยะอันตราย ประเภทเดียวกับขยะที่เป็น สารเคมี วัตถุมีพิษ ซากถ่านไฟฉาย หลอดไฟ และขยะติดเชื้อจากสถานพยาบาล แต่ด้วยความที่มันดูไม่เหมือนขยะ ถึงจะใช้งานไม่ได้แล้ว แต่ก็ยังสามารถนำกลับมาใช้ใหม่ได้อย่างน่ามหัศจรรย์ หากใส่ไอเดียลงไปในหลอดไฟสักหน่อยก็จะสามารถยื่นอายุขยะชิ้นนี้ไปได้อีกนาน…</p>',0,0,0,35,'2023-02-21 00:52:00','2023-03-19 22:35:28','2023-03-19'),(2,'การแยกโลหะเพื่อนำไปหมุนเวียนใช้ใหม่จะถูกลง','การนำโลหะใช้แล้วมาหมุนเวียนใช้ใหม่เป็นวิธีที่ถูกกว่าการแยกโลหะจากแร่เหล็กมากแต่การแยกชิ้นโลหะจากชิ้นส่วนรถยนต์ เครื่องใช้ในครัวเรือนหรือเครื่องมืออุตสาหกรรมเป็นเรื่องที่ทำให้แต่จะได้ชิ้นส่วนโลหะปะปนกันหลายชนิด','1676946930.png','<p>การนำโลหะใช้แล้วมาหมุนเวียนใช้ใหม่เป็นวิธีที่ถูกกว่าการแยกโลหะจากแร่เหล็กมากแต่การแยกชิ้นโลหะจากชิ้นส่วนรถยนต์ เครื่องใช้ในครัวเรือนหรือเครื่องมืออุตสาหกรรมเป็นเรื่องที่ทำให้แต่จะได้ชิ้นส่วนโลหะปะปนกันหลายชนิด เราสามารถทำการแยกชิ้นส่วนที่เป็นโลหะหนักอย่างเหล็กและเหล็กกล้าได้ง่ายกว่าด้วยการใช้แม่เหล็กแรงสูง ในขณะที่โลหะเบาอย่างเช่น ทองแดง อะลูมิเนียมและไททาเนียมอาจจะถูกทิ้งลงหลุมฝังกลบขยะหรือไม่ก็ส่งไปแยกด้วยมือในประเทศที่ค่าจ้างแรงงานถูก แต่ขณะนี้ ทีมนักวิจัยที่มหาวิทยาลัยยูท่าได้พัฒนาวิธีแยกโลหะเบาชนิดต่างๆ ด้วยเครื่องจักรและเป็นวิธีที่มีความแม่นยำในการแยกสูงมาก คุณ Don Eggert นักวิจัยแห่งบริษัท O2M Techmology ที่ร่วมมือกับทีมนักวิจัยจากมหาวิทยาลัยยูท่าในการพัฒนาเทคโนโลยีแยกโลหะเบานี้กล่าวว่าระบบนี้ขึ้นอยู่กับพื้นฐานของความเป็นจริงที่ว่าโลหะทุกประเภทล้วนตอบสนองต่อสนามแม่เหล็กที่มีความแรงสูง เขากล่าวว่าเมื่อหากชิ้นโลหะถูกหย่อนลงไปในสนามแม่เหล็ก หากเป็นโลหะประเภทที่ไม่มีเหล็กผสมอยู่ก็จะไม่เกิดแรงดึงดูดกับสนามแม่เหล็ก แต่แม่เหล็กในระบบที่คิดค้นขึ้นจะเป็นตัวก่อให้เกิดคลื่นไฟฟ้าภายในตัวโลหะชิ้นนั้นและนั่นจะทำให้โลหะชิ้นดังกล่าวสร้างสนามแม่เหล็กขึ้นภายในตัวและทำปฏิกริยากับสนามแม่เหล็กที่ชิ้นโลหะวิ่งผ่านและถูกผลักให้ไปด้านข้าง คุณ Eggert กล่าวว่าการเปลี่ยนแปลงอย่างรวดเร็วในระดับความถี่ของสนามแม่เหล็กจะทำให้ชิ้นโลหะต่างๆ ถูกผลักให้ตกลงไปอยู่ในถังรองรับสำหรับโลหะแต่ละชนิด เขายกตัวอย่างว่าหากต้องการแยกอะลูมิเนียมกับทองแดง ทีมงานสามารถปรับความถี่ของสนามแม่เหล็กให้เหมาะกับการแยกโลหะเบาทั้งสองชนิดนี้โดยเฉพาะ สนามแม่เหล็กจะผลักตัวอะลูมีเนียมออกไปไกลจากตัวแม่เหล็กมากกว่าทองแดง ทำให้ทองแดงตกลงไปในถังที่อยู่ด้านล่างและอะลูมิเนียมจะร่วงลงไปยังอีกถังหนึ่งที่อยู่ห่างออกไป แม้ว่าระบบนี้จะเป็นเพียงหนึ่งในเทคโนโลยีแยกโลหะที่ต่างประเภทกันแต่คุณ Eggert กล่าวว่ามันเป็นระบบที่ง่ายในการสร้างขึ้นเพราะต้องใช้เฉพาะแม่เหล็กกลมขนาดใหญ่เพียงตัวเดียวและตัวควบคุมระดับความถี่ คุณ Eggert กล่าวว่าทีมงานได้คิดคำนวณค่าใช้จ่ายในการก่อสร้างระบบกับผลตอบแทนและเขาคิดว่าจะคุ้มทุนภายในระยะเวลาไม่ถึงปี ในขณะนี้ ตัวแยกโลหะสามารถใช้งานได้กับชิ้นโลหะที่มีความกว้างจนถึงแค่ 1 เซ็นติเมตรเท่านั้น ทีมนักวิจัยกำลังสร้างแม่เหล็กที่มีขนาดใหญ่ขึ้นเพื่อรองรับชิ้นโลหะขนาดใหญ่ขึ้น พวกเขาหวังว่าจะสามารถติดตั้งแม่เหล็กที่กำลังพัฒนาอยู่นี้ภายในโรงงานแยกโลหะได้ภายในปีนี้เพื่อทำการทดลองประสิทธิภาพของระบบในสภาพการทำงานจริงๆ</p>',0,0,0,35,'2023-02-21 09:33:57','2023-03-19 23:03:45','2023-03-19'),(3,'‘WPN’ สนับสนุนโครงการ CSR เพื่อการพัฒนาแหล่งท่องเที่ยว “ชุมชนซับตารี” อย่างยั่งยืน','นายสิทธิชัย ตลับนาค กรรมการผู้จัดการ บริษัท วงษ์พาณิชย์รีไซเคิล ระยอง จำกัด (WPN) ได้ให้การสนับสนุนโครงการพัฒนาแหล่งท่องเที่ยวชุมชนซับตารี ซึ่งเป็นหมู่บ้านชายแดนไทย-กัมพูชา','1676947080.png','<p>นายสิทธิชัย ตลับนาค กรรมการผู้จัดการ บริษัท วงษ์พาณิชย์รีไซเคิล ระยอง จำกัด (WPN) เปิดเผยว่า บริษัทฯ ได้ให้การสนับสนุนโครงการพัฒนาแหล่งท่องเที่ยวชุมชนซับตารี ซึ่งเป็นหมู่บ้านชายแดนไทย-กัมพูชา ตั้งอยู่ที่อำเภอสอยดาว จังหวัดจันทบุรี ด้วยการมอบอุปกรณ์ และสิ่งก่อสร้าง เพื่อทำเส้นทางให้เข้าถึงแหล่งท่องเที่ยวได้สะดวกมากยิ่งขึ้น โดยมีเป้าหมายเพื่อพัฒนาแหล่งท่องเที่ยวอย่างยั่งยืน พร้อมสร้างซับตารีให้เป็นแลนด์มาร์กท่องเที่ยวแห่งใหม่ของไทย</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.wpnrayong.com/media/image_1679079011.png\"></figure><p>&nbsp;</p><p>ภายหลังจากที่ได้ลงพื้นที่ชุมชนซับตารีพบว่า เป็นแหล่งท่องเที่ยวที่มีความอุดมสมบูรณ์ตามธรรมชาติ มีอากาศที่บริสุทธิ์ ชุมชนมีเอกลักษณ์และวัฒนธรรมเฉพาะตัว สามารถที่จะพัฒนาเป็นแหล่งท่องเที่ยวได้ หากได้รับการส่งเสริมด้านโครงสร้างพื้นฐานและสิ่งอำนวยความสะดวกของชุมชนให้มีความพร้อมในการต้อนรับนักท่องเที่ยว</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.wpnrayong.com/media/image_1679078454.png\"></figure><p>&nbsp;</p><p>ดังนั้น WPN ในฐานะผู้นำด้านธุรกิจรีไซเคิลครบวงจร ที่มุ่งมั่นดำเนินธุรกิจด้วยความรับผิดชอบต่อสังคม &nbsp;(CSR: Corporate Social Responsibility) จึงได้นำวัสดุ อุปกรณ์ จากการรีไซเคิลมาใช้ให้เกิดประโยชน์สูงสุด โดยได้นำเหล็ก เชือกเรือ และหลังคาเมทัลชีท มามอบให้กับทางคณะกรรมการหมู่บ้านซับตารี เพื่อใช้ประโยชน์ในด้านต่าง ๆ อาทิ นำเหล็กมาสร้างเป็นแพลตฟอร์มสะพานสำหรับการเดินขึ้นไปยังแหล่งท่องเที่ยว ไม่ว่าจะเป็น เขาระฆัง เขาถ้ำพวงฤษี ฯลฯ ซึ่งเราคาดหวังว่า การจัดทำโครงการในครั้งนี้ จะมีส่วนช่วยในการสนับสนุนและส่งเสริมให้ชุมชนซับตารี ก้าวสู่การเป็นแหล่งท่องเที่ยวที่เป็นหมุดหมายที่สำคัญของประเทศไทยที่ทุกคนอยากมาเยี่ยมเยือน ซึ่งจะเป็นการเพิ่มโอกาสในการสร้างรายได้อย่างยั่งยืนให้แก่ชุมชนซับตารีต่อไป</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.wpnrayong.com/media/image_1679078383.png\"></figure><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; เขาระฆัง</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.wpnrayong.com/media/image_1679078437.png\"></figure><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; เขาถ้ำพวงฤาษี</p>',1,0,0,365,'2023-02-21 09:38:00','2023-08-10 19:42:13','2023-03-19'),(4,'WPN จับมือ TECT จัดกิจกรรม CSR  โครงการ “TECT ร่วมแรงร่วมใจส่งเสริมความปลอดภัยและปรับปรุงสภาพแวดล้อมวัดพยูน”','บริษัท วงษ์พาณิชย์รีไซเคิล ระยอง จำกัด (WPN) ร่วมกับ บริษัท โททาล เอนเนอร์ยี่ส์ คอร์เบียน จำกัด (TECT) จัดกิจกรรม CSR โครงการ “TECT ร่วมแรงร่วมใจส่งเสริมความปลอดภัยและปรับปรุงสภาพแวดล้อมวัดพยูน” ณ วัดชลธาราม (พยูน) ตำบลบ้านฉาง อำเภอบ้านฉาง จ.ระยอง','1691902437.jpg','<h2>WPN จับมือ TECT จัดกิจกรรม CSR&nbsp;<br>โครงการ “TECT ร่วมแรงร่วมใจส่งเสริมความปลอดภัยและปรับปรุงสภาพแวดล้อมวัดพยูน”</h2><p>&nbsp;</p><p>บริษัท วงษ์พาณิชย์รีไซเคิล ระยอง จำกัด (WPN) ร่วมกับ บริษัท โททาล เอนเนอร์ยี่ส์ คอร์เบียน จำกัด (TECT) จัดกิจกรรม CSR โครงการ “TECT ร่วมแรงร่วมใจส่งเสริมความปลอดภัยและปรับปรุงสภาพแวดล้อมวัดพยูน” ณ วัดชลธาราม (พยูน) ตำบลบ้านฉาง อำเภอบ้านฉาง จังหวัดระยอง โดยมีวัตถุประสงค์เพื่อเสริมสร้างการมีส่วนร่วมในกิจกรรมเป็นหมู่คณะ ทั้งในองค์กรและผู้มีส่วนได้ส่วนเสีย สร้างความสัมพันธ์ที่ดีทั้งต่อองค์กร พร้อมส่งเสริมความรู้ด้านความปลอดภัย ด้านอนามัย สิ่งแวดล้อม ซึ่งมีความสอดคล้องกับนโยบายของบริษัทที่มุ่งเน้นให้มีการกำกับดูแลกิจการที่ดี มีธรรมาภิบาลและดำเนินธุรกิจอย่างมีความรับผิดชอบต่อสังคม ผ่านโครงการ CSR ซึ่งเป็นส่วนสำคัญในการสร้างความสมดุลระหว่างชุมชน สังคม และสิ่งแวดล้อม และนำไปสู่เป้าหมายการพัฒนาที่ยั่งยืน</p><figure class=\"image\"><img src=\"https://www.wpnrayong.com/media/S__403316776_1691902293.jpg\"></figure><p>&nbsp;</p><p>โดยเมื่อวันจันทร์ ที่ 19 มิถุนายน 2566 &nbsp;WPN ได้ร่วมสนันสนุนการจัดการด้านขนส่งไม้พาเลทไปยังวัดชลธาราม (พยูน) เพื่อให้ทางพนักงานจิตอาสาใช้ร่วมกันสร้างคอกปุ๋ยใบไม้ให้แก่ทางวัด และในวันศุกร์ ที่ 21 กรกฎาคม 2566 &nbsp;</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.wpnrayong.com/media/S__403316774_1691902354.jpg\"></figure><p>&nbsp;</p><p>พนักงานจิตอาสาของ WPN และบริษัทในเครือ ได้เข้าร่วมทำกิจกรรมการทำความสะอาดในบริเวณวัด &nbsp;อาทิ เก็บ-กวาดใบไม้ ล้างห้องน้ำ เก็บขยะ พร้อมร่วมรับฟังให้ความรู้เรื่องการใช้ถังดับเพลิง และทำบุญถวายเพลร่วมกัน<br>&nbsp;</p><p><img src=\"https://www.wpnrayong.com/media/S__403316773_1691902375.jpg\"></p><p>&nbsp;</p><p><img src=\"https://www.wpnrayong.com/media/S__403316775_1691902375.jpg\"></p><p>&nbsp;</p><p><img src=\"https://www.wpnrayong.com/media/S__403316777_1691902375.jpg\"></p><p><br>&nbsp;</p>',1,0,0,330,'2023-08-13 11:53:57','2023-08-13 12:07:44','2023-08-13'),(5,'test','test','1691991432.jpg','<h3>กรอกรายละเอียด...</h3><p style=\"text-align: center; \"><img src=\"https://wpnrayong.com/img/all_image/1691991417-img-1.jpg\" width=\"100%\" style=\"width: 413.5px; height: 275.664px;\"></p><p style=\"text-align: center; \">test</p>',0,0,0,1,'2023-08-14 12:37:12','2023-08-14 12:37:28','2023-08-14'),(6,'WPN เข้าร่วม “งานแสดงสินค้าบริการและการจัดการของเสีย” (EnwastExpo2023)','บริษัท วงษ์พาณิชย์รีไซเคิล ระยอง จำกัด (WPN) เข้าร่วม “งานแสดงสินค้าบริการและการจัดการ\r\nของเสียหรือ Environmental and Waste Management Expo 2023: EnwastExpo2023 ซึ่งจัดโดย ประธานสภาอุตสาหกรรมแห่งประเทศไทย (ส.อ.ท.) ภายใต้แนวคิด “ร่วมขับเคลื่อนสู่โลกที่ดีกว่า” ระหว่างวันที่ 4-6 ตุลาคม 2566 โดยมี นางสาวพิมพ์ภัทรา วิชัยกุล รัฐมนตรีว่าการกระทรวงอุตสาหกรรม เป็นประธานในพิธีเปิดงาน ร่วมด้วย ดร.จุลพงษ์ ทวีศรี อธิบดีกรมโรงงาน, รศ.ดร.วีริศ อัมระปาล ผู้ว่าการการนิคมอุตสาหกรรมแห่งประเทศไทย, ดร.ปิ่นสักก์ สุรัสวดี อธิบดีกรมควบคุมมลพิษ, นายเกรียงไกร เธียรนุกุล ประธานสภาอุตสาหกรรมแห่งประเทศไทย (ส.อ.ท.) เครือข่ายพันธมิตรสิ่งแวดล้อมทั้งภาครัฐและเอกชนและสื่อมวลชนเข้าร่วมกิจกรรม ณ เวทีกิจกรรม อาคาร 6 ศูนย์แสดงสินค้าและการประชุม อิมแพ็คเมืองทองธานี','1696964570.jpg','<h3><b>WPN เข้าร่วม “งานแสดงสินค้าบริการและการจัดการของเสีย” (EnwastExpo2023)</b></h3><h3><img src=\"https://www.wpnrayong.com/img/all_image/1696589688-S__407396484_0.jpg\" width=\"100%\" style=\"font-size: 14px; text-align: var(--bs-body-text-align);\"><br></h3><h4><br></h4><h4>บริษัท วงษ์พาณิชย์รีไซเคิล ระยอง จำกัด (WPN) เข้าร่วม “งานแสดงสินค้าบริการและการจัดการ<br>ของเสียหรือ Environmental and Waste Management Expo 2023: EnwastExpo2023 ซึ่งจัดโดย ประธานสภาอุตสาหกรรมแห่งประเทศไทย (ส.อ.ท.) ภายใต้แนวคิด “ร่วมขับเคลื่อนสู่โลกที่ดีกว่า” ระหว่างวันที่ 4-6 ตุลาคม 2566 โดยมี นางสาวพิมพ์ภัทรา วิชัยกุล รัฐมนตรีว่าการกระทรวงอุตสาหกรรม เป็นประธานในพิธีเปิดงาน ร่วมด้วย ดร.จุลพงษ์ ทวีศรี อธิบดีกรมโรงงาน, รศ.ดร.วีริศ อัมระปาล ผู้ว่าการการนิคมอุตสาหกรรมแห่งประเทศไทย, ดร.ปิ่นสักก์ สุรัสวดี อธิบดีกรมควบคุมมลพิษ, นายเกรียงไกร เธียรนุกุล ประธานสภาอุตสาหกรรมแห่งประเทศไทย (ส.อ.ท.) เครือข่ายพันธมิตรสิ่งแวดล้อมทั้งภาครัฐและเอกชนและสื่อมวลชนเข้าร่วมกิจกรรม ณ เวทีกิจกรรม อาคาร 6 ศูนย์แสดงสินค้าและการประชุม อิมแพ็คเมืองทองธานี</h4><p><br></p><p><img src=\"https://www.wpnrayong.com/img/all_image/1696589700-S__407396480_0.jpg\" width=\"100%\"><br></p><h6 style=\"text-align: center; color: rgb(0, 0, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">นายสิทธิชัย ตลับนาค กรรมการผู้จัดการ บริษัท วงษ์พาณิชย์รีไซเคิล ระยอง จำกัด (WPN)</h6><h4><br></h4><h4>นายสิทธิชัย ตลับนาค กรรมการผู้จัดการ บริษัท วงษ์พาณิชย์รีไซเคิล ระยอง จำกัด (WPN)&nbsp;กล่าวว่า WPN ในฐานะผู้นำด้านธุรกิจรีไซเคิลที่มีประสบการณ์และความเชี่ยวชาญด้านการรีไซเคิลวัสดุเหลือใช้ระดับประเทศ ด้วยกลยุทธ์ความเชี่ยวชาญมาตรฐานระดับสากล และบุคลากรมืออาชีพ เรามีความมุ่งมั่นที่จะสร้างระบบเศรษฐกิจหมุนเวียน (Circular Economy) โดยคำนึงถึงคุณภาพสิ่งแวดล้อมและความปลอดภัยเป็นสำคัญ และพร้อมให้การสนับสนุนความยั่งยืนของอุตสาหกรรมไทย ด้วยการนำนวัตกรรม เทคโนโลยีที่ทันสมัยมาประยุกต์ใช้ในการดำเนินธุรกิจรีไซเคิล เพื่อให้เกิดการแก้ไขปัญหาเรื่องสิ่งแวดล้อมอย่างยั่งยืน (Environment Sustainability) ภายใต้หลักการกำกับดูแลกิจการที่ดี มีธรรมาภิบาลและมีความรับผิดชอบต่อสังคม เพื่อเป็นส่วนหนึ่งในการร่วมขับเคลื่อนเป้าหมายการพัฒนาที่ยั่งยืนของสหประชาชาติ รวมถึงนโยบาย Carbon Neutrality เพื่อให้ประเทศไทยเป็นผู้นำของอาเซียนในด้านการลดการปล่อยก๊าซเรือนกระจก การพัฒนาที่ยั่งยืนจะเปิดประตูบานใหญ่สู่การค้าโลก ซึ่งถือเป็นโอกาสสำคัญของประเทศไทย”</h4><p><br></p><h4><img src=\"https://www.wpnrayong.com/img/all_image/1696589722-S__407396482_0.jpg\" width=\"100%\"><br></h4><h4><br><span style=\"white-space: normal;\">ทั้งนี้ “งานแสดงสินค้าบริการและการจัดการของเสียหรือ Environmental and Waste Management Expo 2023: EnwastExpo2023 จัดขึ้นภายใต้การสนับสนุนจากหน่วยงานที่กำกับดูแลสิ่งแวดล้อม อาทิ กรมโรงงานอุตสาหกรรม การนิคมอุตสาหกรรมแห่งประเทศไทย กรมควบคุมมลพิษ&nbsp;<br></span></h4><h4><img src=\"https://www.wpnrayong.com/img/all_image/1696589847-S__407396483_0.jpg\" width=\"100%\"><span style=\"white-space: normal;\"><br></span></h4><h4><span style=\"white-space: normal;\"><br></span>กรมส่งเสริมการปกครองส่วนท้องถิ่น กรมอุตสาหกรรมพื้นฐานและการเหมืองแร่ รวมไปถึงภาคเอกชน และสมาคมวิศวกรรมสิ่งแวดล้อมแห่งประเทศไทย นอกจากนี้ ยังมีผู้บริหารโรงงานอุตสาหกรรมขนาดกลาง-ใหญ่กว่า 40,000 โรงงาน เจ้าหน้าที่และผู้บริหารองค์กรปกครองส่วนท้องถิ่นกว่า 10,000 แห่งทั่วประเทศ ตลอดจนนักวิชาการ นักศึกษาและประชาชนทั่วไป โดยมีผู้เยี่ยมชมงานแต่ละวันไม่ต่ำกว่า 10,000 คน มีการเจรจาจับคู่ธุรกิจมากกว่า 300 คู่ มีการสัมมนาและเวิร์คช้อปอีกมากกว่า 20 หัวข้อ และมีบริษัทด้านสิ่งแวดล้อม/แบรนด์ดังเข้าร่วมจัดแสดงสินค้านวัตกรรมมากกว่า 100 บริษัท</h4>',1,0,0,295,'2023-10-06 17:57:50','2023-10-11 02:02:51','2023-10-06');
